import '../../styles/Header.css';

function Header() {
    function changeColor(target) {
        const link = document.querySelectorAll("li");

        for (const item of link) {
            console.log(item);
            if (target.innerHTML === item.innerHTML) {
                console.log(item);
            }

        };

        //e.classList.add("selected");
    }

    return (
        <div className="row text-decoration-none">
            <img className="col-2" src={Logo} alt="freelance" />
            <nav className="col-10 text-end">
                <Link to="/" onClick={e => changeColor(e.target)}>Accueil</Link>
                <Link to="/freelances" className="mx-5">Profils</Link>
                <Link to="/survey/5" className="btn rounded-pill bg-purple">Faire le test</Link>
            </nav>
        </div>
    )
}

export default Header
